import * as React from 'react';
import { styled } from '@material-ui/core/styles';
import ArrowForwardIosSharpIcon from '@material-ui/icons/ArrowForwardIosSharp';
import MuiAccordion, { AccordionProps } from '@material-ui/core/Accordion';
import MuiAccordionSummary, {
  AccordionSummaryProps,
} from '@material-ui/core/AccordionSummary';
import MuiAccordionDetails from '@material-ui/core/AccordionDetails';
import Typography from '@material-ui/core/Typography';

//
import CustomizedAccordiongsHeader from './CustomizedAccordiongsHeader';
import View from './Card/View'
//
const Accordion = styled((props: AccordionProps) => (
  <MuiAccordion disableGutters elevation={0} square {...props} />
))(({ theme }) => ({
  border: `1px solid ${theme.palette.divider}`,
  '&:not(:last-child)': {
    borderBottom: 0,
  },
  '&:before': {
    display: 'none',
  },
}));

const AccordionSummary = styled((props: AccordionSummaryProps) => (
  <MuiAccordionSummary
    expandIcon={<ArrowForwardIosSharpIcon sx={{ fontSize: '0.9rem' }} />}
    {...props}
  />
))(({ theme }) => ({
  backgroundColor:
    theme.palette.mode === 'dark'
      ? 'rgba(255, 255, 255, .05)'
      : 'rgba(0, 0, 0, .03)',
  flexDirection: 'row-reverse',
  '& .MuiAccordionSummary-expandIconWrapper.Mui-expanded': {
    transform: 'rotate(90deg)',
  },
  '& .MuiAccordionSummary-content': {
    margin: 0
  },
}));

const AccordionDetails = styled(MuiAccordionDetails)(({ theme }) => ({
  padding: theme.spacing(2),
  borderTop: '1px solid rgba(0, 0, 0, .125)',
}));

export default function CustomizedAccordions() {
  const [expanded, setExpanded] = React.useState<string | false>('panel1');

  const handleChange =
    (panel: string) => (event: React.SyntheticEvent, newExpanded: boolean) => {
      setExpanded(newExpanded ? panel : false);
    };


    let list =[
      {name: 'Заказ 1', TActual: 920, TPlan: 800,
        products: [
          {name: 'Продукт 1', TActual: 600, TPlan: 800,
          cards: [{
            etapNumeric: 1,
            bufferVSM: {
              name: "Буфер 1"
            },
            etapVSM: {
              name: "Етап 1"
            }
          }
          ]
          }
        ]
      },
    ]

    let listData = list.map((item: any, index: number)=>{

      let idName = "panel"+index+"a-header"
      let ariaControls = "panel"+index+"a-content"



      let itemHeader = {
        name : item.name,
        TActual: item.TActual,
        TPlan: item.TPlan
      }


      console.log(item.products);

      return (  <Accordion>
                <AccordionSummary
                  expandIcon={<ArrowForwardIosSharpIcon/>}
                  aria-controls={ariaControls}
                  id={idName}
                >
                  <Typography sx={{width: '100%',marginLeft:'10px'}}>
                    <CustomizedAccordiongsHeader data={itemHeader}/>
                  </Typography>
                </AccordionSummary>
                <AccordionDetails>
                  <View section={item.products}/>
                </AccordionDetails>
              </Accordion>
      )


    })

    return (
      <div>
        {listData}
      </div>
    );
}


